import React from 'react';
import './Hello.css';

class Hello extends React.Component {
    render(){
        return (
            <div class="container">
            <h1>Shopping List for {this.props.name}</h1>
            <ul>
              <li>Instagram</li>
              <li>WhatsApp</li>
              <li>Oculus</li>
            </ul>
          </div>
            
            );
    }
}

export default Hello;
